import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Navbar from './Components/Navbar/Navbar';
import {BrowserRouter as Router,Routes,Route} from 'react-router-dom';

function App() {
  return (
    <div className="App">

      <Router>
        <Navbar/>
        <Routes>

        <Route path='/' element={<Navbar/>}></Route>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
